export default [{
  path: '/engine',
  name: 'engine',
  component: function component(resolve) {
    return require(["@/views/index"], resolve);
  },
  children: [{
    //工序管理
    path: '/process_list',
    name: 'process_list',
    component: function component(resolve) {
      return require(['@/views/engine/manage/process_list'], resolve);
