      title: '工序管理'
    }
  }, {
    //流程管理
    path: '/course_list',
    name: 'course_list',
    component: function component(resolve) {
      return require(['@/views/engine/manage/course_list'], resolve);
    },
    meta: {
      title: '流程管理'
    }
  }, {
    //工序触发条件
    path: '/trigger_if_list',
    name: 'trigger_if_list',
    component: function component(resolve) {
      return require(['@/views/engine/manage/trigger_if_list'], resolve);
    },
    meta: {
      title: '工序触发条件'
    }
  }, {
    //表单列表
    path: '/config_list',
    name: 'config_list',
    component: function component(resolve) {
      return require(['@/views/engine/config/config_list'], resolve);
    },
    meta: {
      title: '表单配置'
    }
  }, {
    //新增表单配置
    path: '/config_add',
    name: 'config_add',
    component: function component(resolve) {
      return require(['@/views/engine/config/config_add'], resolve);
    },
    meta: {
      title: '新增配置'
    }
  }]
}];

